import React from 'react'
import props from 'prop-types'
import { Box, Card, Image, Heading, Text } from 'rebass'
import logo from '../images/logo512.png'

var projectNames = {"Bunker Down": {projectName:"Bunker Down", projectType:"Video Game"},
                    "DInfinity": {projectName:"DInfinity", projectType:"Video Game"}
                    }
var cards = []

const ProjectCards = () => {
  for (var project in projectNames) {
    cards.push(getProjectCard(project))
  }
  return (cards)
}

function getProjectCard(project) {
  return (
    <Box width={256}>
      <Card
        sx={{
          p: 1,
          borderRadius: 2,
          boxShadow: '0 0 16px rgba(0, 0, 0, .25)',
        }}>
        <Image src={logo}/>
        <Box px={2}>
          <Heading as='h3'>
            {project}
          </Heading>
          <Text fontSize={0}>
            {project["projectType"]}
          </Text>
        </Box>
      </Card>
    </Box>
  )

}

export default ProjectCards;
